@Regrann from @onegreenplanet - A new study conducted by academics from the University of California and Santa Barbara leaves us with new information and statistics regarding the plastic pollution of our planet. The researchers discovered that the total amount of plastic we have produced is equivalent in weight to one billion elephants and it will last for hundreds or even thousands of years, since plastics are not biodegradable and, therefore, remain where they are discarded virtually forever. To put that into context, it would be enough trash to bury Manhattan in more than two miles of trash!

But that is still not the end of the disturbing news – the production of plastic is expected to accelerate further over the next decades. The amount of plastic produced is projected to reach 34 billion by the year 2050.

