@mychelle3 Thanks for the question, the Last straw®️ is dishwasher safe for when you need to deep clean. 
It also comes with a cleaning brush included in the box. Because you are able to collapse our straw half way and then fully, the brush can reach through and clean the inside entirely.

We also recommend when you’re out and don’t have access to a sink, to drink a glass of water with it after use and that gives it a quick rinse before storing it away until you’re able to deep clean it. (Plus we all need another reason to drink more water!)

